import React, { Component } from 'react'

class Table extends Component {
  render() {
    return (
      <table className='routes-table'>
        <thead>
          <tr>
            <th>Airline</th>
            <th>Source</th>
            <th>Destination</th>
          </tr>
        </thead>
        <tbody>
          { 
            this.props.routes.forEach((route) => { return (
              <tr>
                <td>{route.airline}</td>
                <td>{route.src}</td>
                <td>{route.dest}</td>
              </tr>
            )})
          }
        </tbody>
      </table>
    );
  }
}

export default Table
